import React from 'react'
import { AboutMeContainer, AboutMeImage } from './AboutMeElements'

const AboutMe = ({ img }) => {
    return (
        <AboutMeContainer>
            <AboutMeImage alt="AboutMeImage" src={img} />
        </AboutMeContainer>
    )
}

export default AboutMe
